import { IonHeader, IonToolbar, IonTitle } from '@ionic/react';
import React from 'react';

export const Main = () => {
    return (
        <>
            <IonHeader>
                <IonToolbar color="warning">
                    <IonTitle>Main</IonTitle>
                </IonToolbar>
            </IonHeader>
        </>
    );
}
